//import {Container} from 'react-bootstrap';  //npm install react-bootstrap bootstrap@5.1.3
import '../asset/css/style.css';

class Topbanner extends Component{
  render(){
     return(
    <Fragment>
     <div className='topFixBanner'>
       <div className='topBaÃ±nerOverlay'>
       <nav>
        <ul>
          <li>
            <Link to="/Home.js">Home</Link>
          </li>
          <li>
            <Link to="/About">About</Link>
          </li>
          <li>
            <Link to="/Contact">Contact</Link>
          </li>
        </ul>
      </nav>
      <Outlet />
       </div>
     </div>
    </Fragment>
     )
  }
}
export default Topbanner;
